import React, { useState } from 'react';
import './App.css';
import {
    BrowserRouter as Router,
    Route,
    Routes,
    Link
} from "react-router-dom";
//import { Switch } from "react-router";


// Main Page Component
function MainPage() {
    return (
        <div>
            <nav>
                <ul>
                    <li>
                        <Link to="/">Home</Link>
                    </li>
                    <li>
                        <Link to="/about">About</Link>
                    </li>
                    <li>
                        <Link to="/cast">Cast</Link>
                    </li>
                    <li>
                        <Link to="/trailer">Trailer</Link>
                    </li>
                </ul>
            </nav>
            <h1>Welcome to the Paradio Movie Website!</h1>
        </div>
    );
}

// About Page Component
function AboutPage() {
    return (
        <div>
            <h1>About Paradio</h1>
            <p>Paradio is a thrilling new movie about a group of friends who discover a mysterious new world. Join them on an adventure you'll never forget!</p>
        </div>
    );
}

// Cast Page Component
function CastPage() {
    return (
        <div>
            <h1>Cast</h1>
            <ul>
                <li>John Doe as John</li>
                <li>Jane Doe as Jane</li>
                <li>Bob Smith as Bob</li>
                <li>Alice Johnson as Alice</li>
            </ul>
        </div>
    );
}

// Trailer Page Component
function TrailerPage() {
    return (
        <div>
            <h1>Trailer</h1>
            <p>Watch the exciting trailer for Paradio below:</p>
            <iframe
                title="Paradio Trailer"
                width="560"
                height="315"
                src="https://www.youtube.com/embed/dQw4w9WgXcQ"
                frameBorder="0"
                allow="accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture"
                allowFullScreen
            />
        </div>
    );
}

// App Component
export default function App() {
    return (
        <Router>
            <Switch>
                <Route exact path="/">
                    <MainPage />
                </Route>
                <Route path="/about">
                    <AboutPage />
                </Route>
                <Route path="/cast">
                    <CastPage />
                </Route>
                <Route path="/trailer">
                    <TrailerPage />
                </Route>
            </Switch>
        </Router>
    );
}
